"""# ***Se importan las librerias***"""

#Se importan las librerias

import numpy as np
import tensorflow as tf
from keras.preprocessing.image import ImageDataGenerator
import matplotlib.pyplot as plt

"""**Se crean los sets de entrenamiento y validación (Keras)**"""

#Datos de entrenamiento

training_set = tf.keras.utils.image_dataset_from_directory(
    '/content/drive/MyDrive/Fruit_Vegetable_Recognition/Training',
    labels = "inferred",
    label_mode = "categorical",
    class_names = None,
    color_mode = "rgb",
    batch_size = 32,
    image_size = (64, 64),
    shuffle = True,
    seed = None,
    validation_split = None,
    subset = None,
    interpolation = "bilinear",
    follow_links = False,
    crop_to_aspect_ratio = False
    )

#Se validan las imagenes (preprocesadas)

validation_set = tf.keras.utils.image_dataset_from_directory(
    '/content/drive/MyDrive/Fruit_Vegetable_Recognition/Validation',
    labels = "inferred",
    label_mode = "categorical",
    class_names = None,
    color_mode = "rgb",
    batch_size = 32,
    image_size = (64, 64),
    shuffle = True,
    seed = None,
    validation_split = None,
    subset = None,
    interpolation = "bilinear",
    follow_links = False,
    crop_to_aspect_ratio = False
)

"""## ***Creación del modelo***"""

#Se crea el modelo

cnn = tf.keras.models.Sequential()

#Convolution layer - keras
cnn.add(tf.keras.layers.Conv2D(filters = 64, 
                               kernel_size = 3,
                               activation='relu',
                               input_shape=[64,64,3]))

cnn.add(tf.keras.layers.MaxPool2D(pool_size=2,strides=2))

cnn.add(tf.keras.layers.Conv2D(filters=64,
                               kernel_size=3,
                               activation='relu'))

cnn.add(tf.keras.layers.MaxPool2D(pool_size=2,strides=2))

cnn.add(tf.keras.layers.Dropout(0.5))

cnn.add(tf.keras.layers.Flatten())

cnn.add(tf.keras.layers.Dense(units = 128, activation = 'relu'))

cnn.add(tf.keras.layers.Dense(units = 24, activation = 'softmax'))

#Compilación - se mide la presicion

cnn.compile(optimizer = 'rmsprop', loss = 'categorical_crossentropy', metrics = ['accuracy'])

training_history = cnn.fit(x = training_set, validation_data = validation_set, epochs = 1)

"""# ***Se guarda el modelo con un 96% de presición***"""

#Se guarda el modelo

cnn.save('trained_model.h5')

training_history.history

import json

with open ('training_hist.json', 'w') as f:
  json.dump(training_history.history, f)

print (training_history.history.keys())

#Se calcula la presicion del modelo

print("Precisión: {} %".format(training_history.history['val_accuracy'][-1]*100))

